<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta http-equiv="X-UA-Compatible" content="IE=edge">
    <meta name="viewport" content="width=device-width,initial-scale=1,minimum-scale=1,maximum-scale=1,user-scalable=no,viewport-fit=cover">
    <title>Document</title>
    <link rel="stylesheet" href="/style.e308ff8e.css">
<script src="/style.e308ff8e.js"></script></head>
<body>
    <div class="doraemon">
        <div class="face">
            <div class="inside-face">
                <div class="eye border_1_000 border_radio_50 eye-left">
                    <div class="eye-inside">
                        <div class="eye-inside-inside"></div>
                    </div>
                </div>
                <div class="eye border_1_000 border_radio_50 eye-right">
                    <div class="eye-inside">
                        <div class="eye-inside-inside"></div>
                    </div>
                </div>
                <div class="nose border_1_000">
                    <div class="nostril border_radio_50"></div>
                    <div class="nose-down-line"></div>
                </div>
                <div class="mouth">
                    <div class="tongue"></div>
                    <div class="tongue"></div>
                </div>
                <div class="line left-top-line"></div>
                <div class="line left-center-line"></div>
                <div class="line left-bottom-line"></div>
                <div class="line right-center-line"></div>
                <div class="line right-top-line"></div>
                <div class="line right-bottom-line"></div>
            </div>
        </div>
        <div class="body">
            <div class="body-top">
            </div>
            <div class="scarf"></div>
            <div class="body-bottom"></div>
            <div class="bell">
                <div class="bell-circular"></div>
                <div class="bell-line"></div>
            </div>
            <div class="chest">
                <div class="pocket"></div>
            </div>
            <div class="limb limb-left">
                <div class="hand"></div>
                <div class="arm"></div>
            </div>
            <div class="limb limb-right">
                <div class="hand"></div>
                <div class="arm"></div>
            </div>
        </div>
        <div class="foot">
            <div class="foot-left"></div>
            <div class="foot-right"></div>
        </div>
    </div>
</body>
</html>
